CREATE TABLE product (
  id CHAR(36) PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  isWish BOOLEAN NOT NULL,
  price DECIMAL(10, 2) NOT NULL,
  discount INT NOT NULL,
  star DECIMAL(3, 1) NOT NULL,
  image MEDIUMBLOB
);

